import React from 'react';
import './styles/Main.css';

import {
  Switch,
  Route,
} from 'react-router-dom';

const pages = [
  {id: 1, title: 'Experience', path: '/experience'},
  {id: 2, title: 'Skill', path: '/skill'},
  {id: 3, title: 'About', path: '/about'},
  {id: 4, title: 'Home', path: '/'}
]

function Main() {
  const page = pages.map((page) =>
    <Route path={page.path} >
      <h2>{page.title}</h2>
    </Route>
  );

  return (
    <Switch>
      {page}
    </Switch>
  );
}

export default Main;
